import React from "react";
// import { Link } from "react-router-dom";


function List(props) { 
   //  const listLinks = props.links.map((link, index)  => <li key={index}><Link to={`/${link}`}>{link}</Link></li>); 
    const listLinks = props.links.map((link, index)  => <li key={index}>{link}</li>); 
    return (<ul className={props.styleNew} >
      {listLinks}
   </ul>)
}

export default List;
